I'm trying to create a rust app that can read the contents of the clipboard aloud using the elevenlabs.io api. I've been looking at the documentation for the elevenlabs.io api and the `clipboard` crate, but I'm not sure how to put it all together.

Here's what I have so far:

```
use clipboard::ClipboardProvider;
use reqwest::Client;
use serde::Deserialize;

#[derive(Deserialize)]
struct TextToSpeechResponse {
    audio: String,
}

async fn text_to_speech(client: &Client, text: &str) -> Result<String, reqwest::Error> {
    let response = client
        .post("https://api.elevenlabs.io/v1/text-to-speech/21m00Tcm4TlvDq8ikWAM")
        .header("xi-api-key", "YOUR_API_KEY")
        .json(&json!({
            "text": text,
            "voice_settings": {
                "stability": 0.5,
                "similarity_boost": 0.75,
            }
        }))
        .send()
        .await?
        .json::<TextToSpeechResponse>()
        .await?;

    Ok(response.audio)
}

#[tokio::main]
async fn main() -> Result<(), Box<dyn std::error::Error>> {
    let client = Client::new();
    let text = ClipboardProvider::new().get_contents().unwrap();
    let audio = text_to_speech(&client, &text).await?;
    println!("{}", audio);
    Ok(())
}
```

I'm not sure how to play the audio that I get back from the API. I've looked at the `rodio` crate, but I'm not sure how to use it to play the audio that I get back from the API.

Any help would be greatly appreciated!

## Answer (1)

You can use the `rodio` crate to play the audio. Here's an example of how you can do it:

```
use clipboard::ClipboardProvider;
use reqwest::Client;
use serde::Deserialize;
use rodio::{Decoder, Sink, Source};
use std::io::Cursor;

#[derive(Deserialize)]
struct TextToSpeechResponse {
    audio: String,
}

async fn text_to_speech(client: &Client, text: &str) -> Result<String, reqwest::Error> {
    let response = client
        .post("https://api.elevenlabs.io/v1/text-to-speech/21m00Tcm4TlvDq8ikWAM")
        .header("xi-api-key", "YOUR_API_KEY")
        .json(&json!({
            "text": text,
            "voice_settings": {
                "stability": 0.5,
                "similarity_boost": 0.75,
            }
        }))
        .send()
        .await?
        .json::<TextToSpeechResponse>()
        .await?;

    Ok(response.audio)
}

#[tokio::main]
async fn main() -> Result<(), Box<dyn std::error::Error>> {
    let client = Client::new();
    let text = ClipboardProvider::new().get_contents().unwrap();
    let audio = text_to_speech(&client, &text).await?;
    let (stream, stream_handle) = rodio::OutputStream::try_default().unwrap();
    let sink = Sink::try_new(&stream).unwrap();
    let source = Decoder::new(Cursor::new(audio)).unwrap();
    sink.append(source.convert_samples());
    sink.sleep_until_end();
    Ok(())
}
```

